        self.label_48.setWhatsThis(_translate("MainWindow", "<html><head/><body><p><span style=\" font-weight:600;\">Mode -1:</span> This mode is for X-ray binaries for which the eclipse duration of a compact object is known from X-ray observations. The compact star must be star 1. The applied constraint is that the surface potential of the ordinary star (star 2) must be such as to produce the observed X-ray eclipse duration.</p><p><span style=\" font-weight:600;\">Mode 0:</span> No constraints are applied in mode 0, and the component luminosity ratio is not even required to be consistent with the surface temperatures.</p><p><span style=\" font-weight:600;\">Mode 1:</span> This is a mode for overcontact binaries, such as W UMa stars. Six or seven constraints are applied, depending on whether fixed or computed limb darkening is specified.</p><p><span style=\" font-weight:600;\">Mode 2:</span> This mode is for detached binaries with no constraints on the potentials. The only constraint is that the secondary luminosity, L2, is computed from the other parameters via the specified radiation prescription (blackbody or stellar atmosphere).</p><p><span style=\" font-weight:600;\">Mode 3:</span> This mode is for overcontact binaries and is like mode 1 except that the constraints on g2, T2, A2, x2, and y2 are not applied. The other two mode 1 constraints (on Ω1 and L2) are applied in mode 3, but T2, A2, g2, x2, and y2 are free.</p><p><span style=\" font-weight:600;\">Mode 4:</span> This mode is for semi-detached binaries with star 1 accurately filling its limiting lobe, which is the classical Roche lobe for synchronous rotation and a circular orbit, but differs from the classical Roche lobe for non-synchronous and eccentric cases.</p><p><span style=\" font-weight:600;\">Mode 5:</span> The same as mode 4, except that it is star 2 that fills its limiting lobe. This is the usual mode for Algol-type binaries.</p><p><span style=\" font-weight:600;\">Mode 6:</span> This mode is for double contact binaries, in which both stars accurately fill their limiting lobes. Astrophysically this makes sense only if at least one of the stars rotates non-synchronously. Mode 6 applies the surface potential constraints of modes 4 and 5 together.</p></body></html>"))
